import React from 'react';
import { CREATE_ROOM } from "../actions";

const initialState = {
    id: 0,
    room: 'ルーム番号',
}

const testReducer = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            return (
                <div>{state.room}{state.id}</div>
            )
        default:
            return;
    }
}

export default testReducer;
